import { React, useEffect } from "react";
import { useMovieContext } from "../context/movie_context";

export const People_Page = () => {
  const { fetchPeople, people } = useMovieContext();
  useEffect(() => {
    fetchPeople();
  }, []);
  return <div>People</div>;
};

export default People_Page;
